import React from 'react';
import {Button, Container, Nav, Navbar, NavLink} from "react-bootstrap";
import {observer} from "mobx-react-lite";

const MyNavBar = observer(() => {
    return (
        <Navbar>
            <Container>
                <NavLink >Menu</NavLink>

            </Container>
        </Navbar>
    );
});

export default MyNavBar;
